q.asyncTest('Rotate 50 small objects over map', 50, function() {
    engine.prepareWorldData(48, 48, function() {
        engine.createScene('sc1');
        engine.showScene('sc1');
        var i, j, entities = [];
        for (i = 0; i < 10; i++) {
            for (j = 0; j < 5; j++) {
                entities.push({
                    theta: 360, originX: 24, originY: 24,
                    position: {
                        x: i * 2 - (j % 2) + 1,
                        y: (j % 2) * 2 + j
                    }
                })
            }
        }
        setTimeout(function() {
            for (i = 0; i < entities.length; i++) {
                (function() {
                    var player = engine.putEntity(entities[i].position.x, entities[i].position.y, 'player'),
                        startTime = new Date();
                    player.rotate(entities[i].theta,
                                  5000,
                                  entities[i].originX,
                                  entities[i].originY,
                                  function() {
                        var stopTime = new Date(),
                            delta = stopTime.getTime() - startTime.getTime();
                        q.ok(4900 < delta && delta < 5100, 'Small object rotated in about 5 seconds (' + delta + ')');
                    });
                    setTimeout(function() {q.start();}, 6000);
                })();
            }
        }, 1000);
    })
});

