q.asyncTest('Show texts', 3, function() {
    var theFont = 'Arial',
        fontSize = '12px',
        textLeft = {
            text: 'This is a sample text aligned left.',
            properites: {'text-align': 'left', 'font-family': theFont, 'font-size': fontSize},
            position: {w: 300, h: 20, x: 10, y: 10}
        },
        textCenter = {
            text: 'This is a sample text aligned center.',
            properites: {'text-align': 'center', 'font-family': theFont, 'font-size': fontSize},
            position: {w: 300, h: 20, x: 10, y: 40}
        },
        textRight = {
            text: 'This is a sample text aligned right.',
            properites: {'text-align': 'right', 'font-family': theFont, 'font-size': fontSize},
            position: {w: 300, h: 20, x: 10, y: 70}
        };
    //engine.createScene('textScene');
    //engine.showScene('textScene');
    setTimeout(function() {
        engine.putText(textLeft);
        engine.putText(textCenter);
        engine.putText(textRight);
        setTimeout(function() {
            q.ok($('*:contains("' + textLeft.text + '"):last').text() === textLeft.text, 'Text aligned left found');
            q.ok($('*:contains("' + textCenter.text + '"):last').text() === textCenter.text, 'Centered text found');
            q.ok($('*:contains("' + textRight.text + '"):last').text() === textRight.text, 'Text aligned right found');
            q.start();
        }, 500);
    }, 1000);
});

q.asyncTest('Show texts in canvas', 2, function() {
    var theFont = 'Arial';
    var fontSize = '20px';
    var comparedText = {
    		text: 'compared txt',
    		properites: {'text-align': 'left', 'font-family': theFont, 'font-size': fontSize},
    		position: {x: 60, y: 30}
    	};
		engine.prepareCustomWorldData(48,48, 'empty', function(){
        engine.createScene('sampleText');
        setTimeout(function(){
        	engine.showScene('sampleText', function(){
	        	var startTime = new Date();
	        	engine.putTextInCanvas(comparedText);
	        	var stopTime = new Date();
	        	q.ok((stopTime.getTime() - startTime.getTime()) < 250, 'Render time: ' + (stopTime.getTime() - startTime.getTime()));
	        	setTimeout(function(){
		        	var pixelDataPattern = getFixtureToPutTextInCanvas();
		        	var pixelData =	getImageDataFromCanvas('#qunit-test-area > canvas', pixelDataPattern.imageSize.width, pixelDataPattern.imageSize.height);
		        	//if you need to generate new fixture for new browser  uncomment this function
		        	//prepareFixtureFromImageData(pixelData,'#sampleText');
		        	var properRenderStatus = true;
		        	var badPixel = 0;
		        	var countOfPixels = parseInt(pixelDataPattern.imageData.length/4);
		        	
		        	for(var i=0; i <= pixelDataPattern.imageData.length; i+=4){
		        		if(pixelData.data[i] != pixelDataPattern.imageData[i] || pixelData.data[i+1] != pixelDataPattern.imageData[i+1] || pixelData.data[i+2] != pixelDataPattern.imageData[i+2] || pixelData.data[i+3] != pixelDataPattern.imageData[i+3]){
		        			properRenderStatus = false;
		        			badPixel++;
		        		}
		        	}
		        	var percentOfBadPixels = Math.round(badPixel*100/countOfPixels);
		        	q.ok(percentOfBadPixels == 0, "Difference in pixels: "+percentOfBadPixels+"%");
		        	 
		            q.start();
	        	},500);
            });
        }, 1000);
    });
});


function getImageDataFromCanvas(jQueryCanvasSelector, width, height) {
	canvas = $(jQueryCanvasSelector)[0];
	ctx = canvas.getContext('2d');
	return ctx.getImageData(0, 0, width, height);
}

function prepareFixtureFromImageData(imageData, appendjQuerySelector){
	getArrayRgbaFromImageData(imageData)
	$(appendjQuerySelector).append('<div style="width: 1000px; word-wrap: break-word;">'+getArrayRgbaFromImageData(imageData).valueOf()+'</div>');
}

function getArrayRgbaFromImageData(imageData){
	var dataLength = imageData.data.length;
	arrayRGBA = new Array(dataLength);
	for(var i=0; i<= dataLength; i++){
		arrayRGBA[i] = imageData.data[i];
	}
	return arrayRGBA;
}

